css:
@-moz-document domain("discordleaks.unicornriot.ninja") {
::-webkit-scrollbar-track {
             -webkit-box-shadow: inset 0 0 0px rgba(0, 0, 0, 0.3);
             border-radius: 0px;
             background-color: #000;
        }
        html[hide-scrollbar="true"] ::-webkit-scrollbar{display:none}
        ::-webkit-scrollbar {
             width: 8px;
             background-color: #000;
        }
        ::-webkit-scrollbar-thumb {
             border-radius: 0px;
             -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, .6);
             background-color: #fe0;
			 border: 1px solid #000;
        }

body {
	background: #111;
	color: #d1d5d9;
}
.discord-message-wrap .discord-message {
	background: #101010;
}
.discord-message-wrap .discord-message .discord-message-meta-wrapper div.discord-message-meta div.discord-message-meta-items span.discord-message-meta-timestamp {
	color: #aaa;
}
input, textarea, option, select {
	background: #111;
	border: 1px solid #222;
	color: #d1d5d9;
}
.alert-info {
    color: #2ce1ff;
    background-color: #313839;
    border-color: #5e7275;
}
.alert-info .alert-link {
    color: #2df;
}
footer.footer--outer div#footer--inner .footer--items .footer--item a {
	color: #aaa;
}
.form-control {
	background: #111 !important;
	color: #b9a0a7 !important;
	border-color: #4e5255;
}
.discord-server-wrap .discord-server, .discord-user-wrap .discord-user {
	border-color: #555;
}
}
